// components/AddNewCar.js
import React, { useState, useEffect } from 'react';
import './GetAllCars.css';

export default function AddNewCar(props) {
  const [carData, setCarData] = useState({
    brand: '',
    type: '',
    color: '',
    myear: '',
  });
  const [isUpdateMode, setIsUpdateMode] = useState(false);

  useEffect(() => {
    if (props.carToUpdate) {
      setIsUpdateMode(true);
      setCarData({
        brand: props.carToUpdate.brand || '',
        type: props.carToUpdate.type || '',
        color: props.carToUpdate.color || '',
        myear: props.carToUpdate.myear ? new Date(props.carToUpdate.myear).toISOString().split('T')[0] : '',
      });
    } else {
      setIsUpdateMode(false);
      setCarData({
        brand: '',
        type: '',
        color: '',
        myear: '',
      });
    }
  }, [props.carToUpdate]);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setCarData({ ...carData, [name]: value });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    const url = `http://localhost:5000/cars${isUpdateMode ? `/${props.carToUpdate._id}` : ''}`;
    const method = isUpdateMode ? 'PUT' : 'POST';

    try {
      const request = await fetch(url, {
        method: method,
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(carData),
      });

      if (!request.ok) {
        console.error(`Hiba a ${isUpdateMode ? 'módosítás' : 'hozzáadás'} során (${request.status}): ${request.statusText}`);
        return;
      }

      console.log(`Autó sikeresen ${isUpdateMode ? 'módosítva' : 'hozzáadva'}.`);
      if (isUpdateMode) {
        props.onUpdateComplete();
      } else {
        props.onCarAdded(); // Notify parent component about new car
      }
      setCarData({ brand: '', type: '', color: '', myear: '' }); // Reset form
    } catch (error) {
      console.error('Hiba történt a kérés küldésekor:', error);
    }
  };

  return (
    <div className="add-new-car-container">
      <h2>{isUpdateMode ? 'Autó szerkesztése' : 'Új autó hozzáadása'}</h2>
      <form onSubmit={handleSubmit} className="car-form">
        <div className="form-group">
          <label htmlFor="brand">Márka</label>
          <input type="text" id="brand" name="brand" value={carData.brand} onChange={handleChange} className="form-control" required />
        </div>
        <div className="form-group">
          <label htmlFor="type">Típus</label>
          <input type="text" id="type" name="type" value={carData.type} onChange={handleChange} className="form-control" required />
        </div>
        <div className="form-group">
          <label htmlFor="color">Szín</label>
          <input type="text" id="color" name="color" value={carData.color} onChange={handleChange} className="form-control" required />
        </div>
        <div className="form-group">
          <label htmlFor="myear">Gyártási év</label>
          <input type="date" id="myear" name="myear" value={carData.myear} onChange={handleChange} className="form-control" required />
        </div>
        <button type="submit" className="btn btn-primary">
          {isUpdateMode ? 'Mentés' : 'Hozzáadás'}
        </button>
        {isUpdateMode && (
          <button type="button" className="btn btn-secondary" onClick={() => {
            setIsUpdateMode(false);
            setCarData({ brand: '', type: '', color: '', myear: '' }); // Reset form on cancel
          }}>
            Mégse
          </button>
        )}
      </form>
    </div>
  );
}
